import React from 'react';
import home_3 from '../images/home_3.jpg';
import ThSection from './TH_SECTION'
class SecSection extends React.Component {
    render() {

        return (
            <section className="section sec_section">
                <div className="content">
                <div className="normal">
                        <img src={home_3}></img>
                    </div>
                    <div className="small_squaer">
                        <h2>Location</h2>
                        <div className="short_border"></div>
                    </div>
                </div>
              
                <ThSection />
            </section>
        )
    }
}






            
export default SecSection;
